import  MenuItem  from './MenuItem';
import React from 'react';
import Icon from "../Atoms/Icon/Icon";
class Menu extends React.Component {
    
    render() {
        return (
            <>
                <ul>
                    {this.props.list.map(item => (
                        <>
                        <Icon item={item}/>
                        <MenuItem key={item.id} item={item} />
                        </>
                    ))}
                </ul>
            </>
        );
    }
}

export default Menu;
